import "./styles.css";

const OutputResult = ({ output }) => {
  return (
    <div className="output-container">
      <h3>Output</h3>
      <div className="output-field">
      <textarea
        readOnly
        value={output}
        style={{ width: "100%", height: "200px" }}/>   
      </div>
    </div>
  );
};

export default OutputResult;
